import React from 'react';

function Home() {
    return (
        <div className="container">
            <div className="card">
                <h2>Welcome to My Portfolio</h2>
                <p>This is the home page of my portfolio. Here you can find information about me and my projects.</p>
            </div>
        </div>
    );
}

export default Home;
